import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";
import {
  Grid,
  Typography,
  Table,
  TableContainer,
  TableHead,
  TableBody,
  TableCell,
  Switch,
  TableRow,
} from "@material-ui/core/";

function Home() {
  // state init
  const [active, setactive] = useState({ statusSwitch: false });
  const whitelist = useSelector((state) => state.whitelist);
  console.log(whitelist);

  const handleChange = () => {
    setactive({
      statusSwitch: !active.statusSwitch,
    });
  };

  return (
    <Grid container xs={12} justify="center" alignItems="center">
      <Grid item xs={10}>
        <TableContainer>
          <Table aria-label="simple-table">
            <TableHead>
              <TableRow>
                <TableCell>id</TableCell>
                <TableCell>name</TableCell>
                <TableCell>active</TableCell>
                <TableCell>delete</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <TableRow>
                <TableCell>1</TableCell>
                <TableCell>Asep Imam Nawawi</TableCell>
                <TableCell>
                  <Switch
                    checked={active.statusSwitch}
                    onChange={handleChange}
                    name="checkedA"
                  />
                </TableCell>
                <TableCell>1</TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </TableContainer>
      </Grid>
    </Grid>
  );
}

export default Home;
